import React from 'react';
import ReactDOM from 'react-dom';
import {Item} from './Item';

export function Lista({listaItems})
{
	return ( <ul>
     {listaItems.map((item) => (
		 <li>Item item={item}</li> 
	 ))}
	</ul>
	);
}
